import HomePageText from './HomePageText';
import { SplitScreen } from '../UtilComponents/SplitScreen';
import {Image, View} from 'react-native';

const profilePhoto = require('./Profile_Photo.jpg');

const ProfilePhotoComponent = () => {
    return (
        <View>
            <Image source= {profilePhoto} alt='ProfilePhoto' width = '100%'  style={{borderColor: 'black', borderWidth: 5}}/>
        </View>
    )
}


function HomePage() {
    return (
    <SplitScreen leftWeight = {1} rightWeight = {3}>
        <ProfilePhotoComponent/>
        <HomePageText/>
    </SplitScreen>)
}

export default HomePage;
